import {createMuiTheme} from "@material-ui/core/styles";

const myBlue = "#00017c";
const myGreen = "#4ec274";

export default createMuiTheme({
    palette: {
        common: { blue: `${myBlue}`, green: `${myGreen}`},
        primary: { main: `${myBlue}`},
        secondary: { main: `${myGreen}`},
    }, 
    typography: {
        p: {}, 
        h1: {},
    },
})
